abstracts.content:
We aimed to investigate changes in postural stability on a stable surface after the application of dynamic tape for patients with inversion ankle sprains. This study enrolled 30 patients (age 25.5 ± 8.0 years) with grade I and II ankle sprains, which occurred 7–21 days before enrolment. Postural stability (balance, coordination, feedback) was assessed before and after the application of dynamic tape using a stabilographic platform. Three 32-s exercises were performed on the stabilographic platform, one with eyes open, one with eyes closed and one with visual feedback. After the application of dynamic tape, an improvement was observed in terms of the mean radius of sway (4.2 ± 1.3 mm vs. 3.4 ± 0.9 mm; p = 0.012) and coordination (48.8 ± 19.2% vs. 59.3 ± 5.8%;
p = 0.021). Selected balance parameters did not improve significantly in the tests with open and closed eyes. Asymmetric load improved for all tests, but significant differences were only observed with eyes closed (34.9 ± 24.4 vs. 41.7 ± 30.5; p < 0.01). We concluded that the use of dynamic tape after an ankle sprain significantly improved balance and coordination on a stable surface. The benefits
were shown in terms of a significant improvement in the asymmetric load of the injured limb in comparison to the healthy limb during the test with closed eyes and a considerable improvement in the asymmetric load that was evaluated with visual feedback on a stable surface.
